import React, { Component } from 'react';

class Page extends Component {
    render() {
        return (
            <div>
                <p>I am the Page component</p>
                My name is Odewale Bosede
                I have a very big head and I can disturb for Africa
                {this.props.children}
            </div>
        )
    }
}

export default Page;
